function List(props){
    const {data} = props;
    console.log(props)
    const List=data.map((e)=>{
      return(
        <li>Name : {e.name}, <br></br>Branch : {e.branch}</li>
      )  
    })
    return(
        <ul>
          {List}
        </ul>
    )
  }
  export default List;
